import { Component } from 'react';
import { Col } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { connect } from 'react-redux';

class PresentationOfTheCompany extends Component {
    render() {
        return (
            <>
                <Row>
                    <Col lg={{ offset: 1, span: 10 }}>
                        <div className="presentationOfTheCompany-body">
                            <div className="presentationOfTheCompany-CompanyInformation">
                                WE ARE THE BEST BISNES IN THE WORLD. OUR COMPANY ITS JUST A DREAM ITS A MEANING OF LIFE.
                                OUR COMPANY IS BILLIONS OF YEARS OLS
our company is billions of years old
                            </div>
                        </div>
                    </Col>
                </Row>
            </>
        );
    }
}

export default connect(null, null)(PresentationOfTheCompany);
